import React, { ReactElement } from "react";

const Blocks = (props: { text: string }): ReactElement => {
  return (
    <>
      <div style={{ height: "10em", width: "14em", backgroundColor: "grey", display: "flex", flexDirection: "column" }}>
        <>{props.text}</>
        <>{props.text}</>
      </div>
    </>
  );
}

export default Blocks;
